import React from 'react';
import "./SearchPage.css";
import  TuneOutlinedIcon  from '@material-ui/icons/TuneOutlinedIcon';

function SearchPage() {
    return (
        <div className="SearchPage">
            <div className="searchPage__filter">
                <TuneOutlinedIcon />
                <h1>FILTER</h1>
            </div>
        </div>
    )
}

export default SearchPage
